description:
From the creators of &quot;Not the Brady XXX&quot; and the AVN Best Comedy winner &quot;Not Bewitched XXX&quot; comes a hilarious porn comedy about airports, jets and horny flight attendants. Desperate to compete with the #1 rival airline following a recent jet crash, Global Air resorts to hilarious PR stunts and sexy new uniforms to lure in new passengers. Wild hijinks and naughty sex acts abound as beautiful flight attendants fight for air superiority in this deliciously dirty airplane fuck-fest. If you liked Airplane, you'll love &quot;Flight Attendants&quot;!

